// This script calculates the users score using the results in localstorage.
window.onload = (event) => {
    //  Setup localstorage for score
    let results = localStorage.getItem('userFin')
    console.log("Yes loaded")

    // Get the users info and post it into the results page
    let userFirst = localStorage.getItem('firstName')
    let userLast = localStorage.getItem('lastName')
    let userEmail = localStorage.getItem('userEmail')


    let userName = userFirst + " " + userLast
    NewUser = userName.replace(/"/g, '');
    NewEmail = userEmail.replace(/"/g, '');
    userName.replace("",)

    // document.getElementById('userResults').innerText = resultPercent 
    // document.getElementById('userName').value = NewUser
    // document.getElementById('userEmailAddr').value = NewEmail
    // document.getElementById('userResults').value = results + "%."

    document.getElementById('uName').innerText = NewUser
    document.getElementById('uEmail').innerText = NewEmail
    document.getElementById('uResults').innerText = results

    // Listener for the button
    $('#certBtn').click(function () {
        // console.log("your in the listener")
        // window.location.replace("../pages/certificate.html")
        onDownload();
    });


    // Set up image variable
    const certificatePNG = ('data:image/png;base64,');

    ///////////////////////////////////////////////////////////////////////////////////////
    ///////////////////////////////////////////////////////////////////////////////////////



    const onDownload = () => {
        // check Pen Settings for included libs
        // yWorks/jsPDF & sphilee/jsPDF-CustomFonts

        //const pdfSize = 71;

        const pdf = new jsPDF('l', 'mm', 'letter');


        // define custom font
        pdf.addFileToVFS("DancingScript-Regular.ttf",
            // ttf font file converted to base64 
            // following is Consolas with only hex digit glyphs defined (0-9, A-F)
            "");


        // add custom font to file
        pdf.addFont("DancingScript-Regular.ttf", "DancingScript-Regular", "normal");
        pdf.setFont("DancingScript-Regular", "normal");
        pdf.setFontSize(60);

        //console.log(pdf.getFontList());
        pdf.addImage(certificatePNG, "PNG", 3, 7, 273, 200);
        // pdf.text("Lamar Clapham", 85, 105, null, 90);
        pdf.text(NewUser, 136, 110, 'center');



        // Get the date setup
        var d = new Date();
        const months = ["January", "February", "March", "April", "May", "June", "July",
            "August", "September", "October", "November", "December"];
        var day = d.getDate();
        var month = d.getMonth(); // Since getMonth() returns month from 0-11 not 1-12
        var year = d.getFullYear();

        var dateStr = months[month] + " " + day + ", " + year;
        pdf.setFontSize(16);
        pdf.text(dateStr, 94, 165, 'center');




        // Centering text on fill in sections
        // var centerText = function (text, y) {
        //     var textWidth = pdf.getStringUnitWidth(text) * pdf.internal.getFontSize(); // / pdf.scaleFactor();
        //     var textOffset = (pdf.internal.pageSize.width - textWidth) / 2;
        //     pdf.text(textOffset, y, text)
        // }

        var testText = "Phishing-Certificate"
        // centerText()

        pdf.save(testText, 105)
    };







};

